        let item = e.target.value;
        if (e.target.checked) {
            this.ppeSelectedArr.push(item);
        }
        else {
            this.ppeSelectedArr.forEach((item, j) => {
                if (item == e.target.value) {
                    this.ppeSelectedArr.splice(j, 1);
                    return;
                }
            });
        }
        console.log("ppeSelectedArr", this.ppeSelectedArr);
